import React, { useState, useEffect } from 'react';
import { PlusIcon, PencilIcon, TrashIcon, BuildingOfficeIcon, MapPinIcon, UsersIcon, ExclamationTriangleIcon } from '@heroicons/react/24/outline';
import toast from 'react-hot-toast';
import axios from 'axios';

// Set up axios defaults
axios.defaults.baseURL = 'http://localhost:5000';

function Rooms() {
  const [rooms, setRooms] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showModal, setShowModal] = useState(false);
  const [editingRoom, setEditingRoom] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [filterBuilding, setFilterBuilding] = useState('');
  const [showDeleteModal, setShowDeleteModal] = useState(false);
  const [deleteData, setDeleteData] = useState(null);
  const [modalAnimation, setModalAnimation] = useState('hidden');

  const [formData, setFormData] = useState({
    room_number: '',
    room_name: '',
    building: '',
    capacity: '',
    room_type: 'classroom'
  });

  const roomTypes = [
    { value: 'classroom', label: 'Classroom' },
    { value: 'laboratory', label: 'Laboratory' },
    { value: 'office', label: 'Office' }
  ];

  useEffect(() => {
    fetchRooms();
  }, []);

  const fetchRooms = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');

      if (!token) {
        toast.error('Please login to access rooms');
        return;
      }

      const headers = { Authorization: `Bearer ${token}` };
      const response = await axios.get('/api/rooms', { headers });

      setRooms(response.data.rooms || []);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`2964653256_53_6_53_51_11`,'Error fetching rooms:', error));
      if (error.response?.status === 401) {
        toast.error('Session expired. Please login again.');
        localStorage.removeItem('token');
        window.location.href = '/login';
      } else {
        toast.error('Failed to load rooms');
      }
    } finally {
      setLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const headers = { Authorization: `Bearer ${token}` };

      if (editingRoom) {
        // Update existing room
        await axios.put(`/api/rooms/${editingRoom.ROOMID}`, formData, { headers });
        toast.success('Room updated successfully');
      } else {
        // Create new room
        await axios.post('/api/rooms', formData, { headers });
        toast.success('Room created successfully');
      }

      await fetchRooms(); // Refresh data
      setShowModal(false);
      resetForm();
      setEditingRoom(null);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`2964653256_87_6_87_48_11`,'Error saving room:', error));
      if (error.response?.data?.message) {
        toast.error(error.response.data.message);
      } else {
        toast.error('Failed to save room');
      }
    }
  };

  const resetForm = () => {
    setFormData({
      room_number: '',
      room_name: '',
      building: '',
      capacity: '',
